import './Navbar.css';
import './SmoothScrolling.js';

function Navbar () {
    return (
        <div className="navbar">
            <a className="navbar-option" href='#top'>Home</a>
            <a className="navbar-option" href="#startSection01">Section 01</a>
            <a className="navbar-option" href="#startSection02">Section 02</a>
        </div>
    );
}

export default Navbar;
